import React from "react";
import Map from '../components/Map';

const Home = () => {
    return (
        <div>
            <div class="left-column">
                <h1>Who We Are</h1>
                <h1>What We Do</h1>
            </div>
            <div class="right-column">
                <p>Wall Hours</p>
                <p>Fall</p>
                <p>J Term</p>
                <p>Spring</p>
                <p>Summer</p>
            </div>
        </div>

    );
}

export default Home;
